import React, { useState } from 'react'
import './event.css';

const Event = (props) => {

  const [toggleEvent, setToggleEvent] = useState(false);

  const EventPlus = () => (
    <>
      <div className='website__events-resultados'>
        <h2>Resultados</h2>

      </div>
    </>
  )

  return (
    <div>
        <div className='website__eventos-contentiner-evento' onClick={() => {setToggleEvent(!toggleEvent)}}>
            <h2>{props.evento.nombre}</h2>
            <p><strong>Fecha:</strong> {props.evento.fecha}</p>
            <p><strong>Lugar:</strong> {props.evento.lugar}</p>
            {toggleEvent && (
                  <EventPlus />
            )}
        </div>
    </div>
  )
}

export default Event
